def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data._try_coerce_results()

    results = self.grouper.aggregate(data, how, axis=self.axis, min_count=min_count)

    agg_blocks, agg_items = [], []

    for key, result in results:
        if result is NotScalar:
            # The result is a DataFrame, move it directly into the new blocks.
            result.blocks[:, key] = data.blocks[:, key]
            agg_items.append(key)
            agg_blocks.append(result)
        else:
            # The result is a scalar, we need to create a new block with the same type as the original block.
            agg_block = type(data.blocks[:, key])(result, dtype=data.blocks[:, key].dtype)
            agg_items.append(key)
            agg_blocks.append(agg_block)

    return agg_blocks, agg_items
